import React, { Component } from 'react'
import { NavLink } from 'react-router-dom';
import LikedIcon from '../../../Icons/LikedIcon';
import UnlikedIcon from '../../../Icons/UnlikedIcon';
import ListIcon from '../../../Icons/ListIcon';
export default class SongListBlock extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  changePage = (page) => {

  }
  // userId
  // updateTime
  // playCount
  // creator
  // coverImgUrl
  // anonimous
  render() {
    const { playlist } = this.props;
    console.log("playlist", playlist)
    return (
      <div className="SideBar-unit">
        <div className="title">创建的歌单</div>
        <ul>
          {playlist.map((l, idx) => {
            return (
              <li className="list-item" key={idx}>
                <div className='icon'>{(l.specialType == 0) ? <UnlikedIcon /> : <ListIcon />}</div>
                <NavLink to={`/songlist/${l.id}`}>{l.name}</NavLink>
              </li>
            )
          }
          )}
        </ul>
      </div>

    );
  }
}
